import * as React from 'react';
import Button from '@mui/material/Button';

function Buttons({click,text,width,icon}) {
  return <Button variant="contained"onClick={() => {click()}} style={{  backgroundColor:"#00D09C" }}>{text}</Button>;
}

export default Buttons;
